    /**
     * 给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。
     * *bwftag  一般特性 连续子串 滑动窗口 状态ok
     *
     * @param s
     * @return
     */
    private int lengthOfLongestSubstring(String s) {
        char[] chars = s.toCharArray();
        e = 0;
        int b = 0;
        while (e < chars.length) {
            int ind = findKey(chars, b, e, chars[e]);
            if (ind < 0) {
                e++;
                if (e - b > max) {
                    max = e - b;
                }
            } else {
                b = ind + 1;
                e++;
            }
        }
        return max;
    }

    private int findKey(char[] chars, int b, int e, char aChar) {
        for (int i = b; i < e; i++) {
            if (aChar == chars[i]) {
                return i;
            }
        }
        return -1;
    }
